/*Table structure for table `sys_filecommodity` */

DROP TABLE IF EXISTS `sys_filecommodity`;

CREATE TABLE `sys_filecommodity` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id主键',
  `sku` varchar(100) NOT NULL COMMENT '商品编码SKU',
  `siteCode` varchar(50) DEFAULT NULL COMMENT '门店编码 （接口中的客户代码即门店帐号）',
  `template` varchar(128) DEFAULT NULL COMMENT '模板ID',
  `unit` varchar(128) DEFAULT NULL COMMENT '单位',
  `placeOfOrigin` varchar(128) DEFAULT NULL COMMENT '产地',
  `specification` varchar(128) DEFAULT NULL COMMENT '规格',
  `qrCode` varchar(128) DEFAULT NULL COMMENT '二维码',
  `price2` varchar(128) DEFAULT NULL COMMENT '促销价',
  `price3` varchar(128) DEFAULT NULL COMMENT '会员价',
  `price5` varchar(128) DEFAULT NULL COMMENT '市场零售价',
  `brandName` varchar(50) DEFAULT NULL COMMENT '商标',
  `grade` varchar(128) DEFAULT NULL COMMENT '等级',
  `promoDateFrom` varchar(128) DEFAULT NULL COMMENT '促销开始日期',
  `promoDateTo` varchar(128) DEFAULT NULL COMMENT '促销结束日期',
  `promoTimeFrom` varchar(128) DEFAULT NULL COMMENT '促销开始时间',
  `promoTimeTo` varchar(128) DEFAULT NULL COMMENT '促销结束时间',
  `vipDateFrom` varchar(128) DEFAULT NULL COMMENT '会员开始日期',
  `vipDateTo` varchar(128) DEFAULT NULL COMMENT '会员结束日期',
  `vipTimeFrom` varchar(128) DEFAULT NULL COMMENT '会员开始时间',
  `vipTimeTo` varchar(128) DEFAULT NULL COMMENT '会员结束时间',
  `fileNo` varchar(50) DEFAULT NULL COMMENT '文件编码 需要建索引',
  `createDate` datetime DEFAULT NULL COMMENT '创建时间',
  `createBy` varchar(50) DEFAULT NULL COMMENT '创建人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8;

/*Data for the table `sys_filecommodity` */

