/*Table structure for table `sys_sessiontoken` */

DROP TABLE IF EXISTS `sys_sessiontoken`;

CREATE TABLE `sys_sessiontoken` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `sessionToken` varchar(50) NOT NULL COMMENT 'sessionToken（登入时的唯一识别码）',
  `user` varchar(50) DEFAULT NULL COMMENT '登入帐号',
  `loginTime` datetime DEFAULT NULL COMMENT '登入时间',
  `invalidTime` datetime DEFAULT NULL COMMENT '失效时间',
  `state` varchar(10) DEFAULT NULL COMMENT '状态',
  PRIMARY KEY (`id`),
  UNIQUE KEY `only` (`sessionToken`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

