/* Procedure structure for procedure `erp` */

/*!50003 DROP PROCEDURE IF EXISTS  `erp` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `erp`()
BEGIN
	#SELECT b.* FROM sys_erp a,sys_commodity b WHERE  a.`sku`=b.`sku` AND a.`siteCode`=b.`siteCode`
	UPDATE sys_commodity b,sys_erp a SET b.itemName=a.`itemName` , b.price1=a.`price1` , b.siteCode=a.siteCode
	WHERE a.`sku`=b.`sku` AND a.`siteCode`=b.`siteCode`;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `execute_seckill` */

/*!50003 DROP PROCEDURE IF EXISTS  `execute_seckill` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `execute_seckill`(in parter int)
BEGIN
	declare var int;
	set var = parter+1;
	if var=1 then 
	insert into `erp` values('1','1','1','1',now());
	end if;
	if parter=0 then
	update `erp` set sku='2' where siteCode='1';
	else 
	UPDATE `erp` SET sku='3' WHERE siteCode='1';
	end if;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `Inerp` */

/*!50003 DROP PROCEDURE IF EXISTS  `Inerp` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Inerp`()
BEGIN
	call erp();
	INSERT INTO sys_commodity (sku,siteCode,itemName,price1) 
	SELECT sku,siteCode,itemName,price1 FROM sys_erp WHERE id NOT IN(SELECT a.`id` FROM sys_erp a,sys_commodity b WHERE  a.`sku`=b.`sku` AND a.`siteCode`=b.`siteCode`);
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `Inupload` */

/*!50003 DROP PROCEDURE IF EXISTS  `Inupload` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Inupload`(IN p_fileNo VARCHAR(50))
BEGIN
	CALL upload(p_fileNo);
	UPDATE `sys_commodity` a,`sys_filecommodity` b SET a.`unit`=b.`unit` , a.`template`=b.`template` , a.`brandName`=b.`brandName` , a.placeOfOrigin=b.`placeOfOrigin`,a.qrCode=b.`qrCode`,a.`price2`=b.`price2`,a.`price3`=b.`price3`,a.`price5`=b.`price5`,a.grade=b.`grade`,a.promoDateFrom=STR_TO_DATE(b.`promoDateFrom`,'%Y-%m-%d') ,a.promoDateTo=STR_TO_DATE(b.`promoDateTo`,'%Y-%m-%d'),a.promoTimeFrom=STR_TO_DATE(b.`promoTimeFrom`,'%H:%i:%s'),a.promoTimeTo=STR_TO_DATE(b.`promoTimeTo`,'%H:%i:%s'),a.vipDateFrom=STR_TO_DATE(b.`vipDateFrom`,'%Y-%m-%d'),a.vipDateTo=STR_TO_DATE(b.`vipDateTo`,'%Y-%m-%d'),a.vipTimeFrom=STR_TO_DATE(b.`vipTimeFrom`,'%H:%i:%s'),a.vipTimeTo=STR_TO_DATE(b.`vipTimeTo`,'%H:%i:%s'),
		a.fileNo=b.`fileNo`,a.createBy=b.`createBy`
	WHERE b.`fileNo`=a.`fileNo` AND a.`fileNo`=p_fileNo AND a.`sku`=b.`sku` AND b.`siteCode`NOT IN(SELECT a.`siteCode` FROM
	(SELECT DISTINCT c.`sku`,c.`siteCode` FROM `sys_filecommodity` c,`sys_commodity` d WHERE c.sku=d.sku AND c.siteCode=d.siteCode)a);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `upload` */

/*!50003 DROP PROCEDURE IF EXISTS  `upload` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `upload`(IN p_fileNo VARCHAR(50))
BEGIN
	UPDATE `sys_commodity` a,`sys_filecommodity` b SET a.`unit`=b.`unit` , a.`template`=b.`template` , a.`brandName`=b.`brandName` , a.placeOfOrigin=b.`placeOfOrigin`,a.qrCode=b.`qrCode`,a.`price2`=b.`price2`,
	a.`price3`=b.`price3`,a.`price5`=b.`price5`,a.grade=b.`grade`,a.promoDateFrom=STR_TO_DATE(b.`promoDateFrom`,'%Y-%m-%d') ,a.promoDateTo=STR_TO_DATE(b.`promoDateTo`,'%Y-%m-%d'),a.promoTimeFrom=STR_TO_DATE(b.`promoTimeFrom`,'%H:%i:%s'),
	a.promoTimeTo=STR_TO_DATE(b.`promoTimeTo`,'%H:%i:%s'),a.vipDateFrom=STR_TO_DATE(b.`vipDateFrom`,'%Y-%m-%d'),a.vipDateTo=STR_TO_DATE(b.`vipDateTo`,'%Y-%m-%d'),a.vipTimeFrom=STR_TO_DATE(b.`vipTimeFrom`,'%H:%i:%s'),a.vipTimeTo=STR_TO_DATE(b.`vipTimeTo`,'%H:%i:%s'),
	a.fileNo=b.`fileNo`,a.createBy=b.`createBy`
	WHERE a.`sku`=b.`sku` AND a.`siteCode`=b.`siteCode` and b.fileNo=p_fileNo;
    END */$$
DELIMITER ;

